import React, { useState } from 'react';

const PrizeDistribution = () => {
  const [message, setMessage] = useState('');

  const distributePrizes = async () => {
    try {
      const response = await fetch('http://localhost:5000/distributePrizes', {
        method: 'POST', // POST methodu kullanıyoruz
        headers: {
          'Content-Type': 'application/json',
        },
      });

      if (response.ok) {
        const data = await response.text();
        setMessage(data);  // Sunucudan gelen mesajı kullanıcıya göster
      } else {
        setMessage('Error distributing prizes');
      }
    } catch (error) {
      setMessage('Error occurred: ' + error.message);
    }
  };

  return (
    <div>
      <h2>Prize Distribution</h2>
      <button onClick={distributePrizes}>Distribute Prizes</button>
      {message && <p>{message}</p>}
    </div>
  );
};

export default PrizeDistribution;
